import React from 'react'
import Frame from '../img/candidates/img.png'

// const candidates = [
//     {id: 1, name: 'Konang Tygazayn', division: 'Mikat'},
//     {id: 2, name: 'Kadek Ninda', division: 'Hublu'},
//     {id: 3, name: 'Billy Fahd Qodama', division: 'PSDMA'}
// ];

const Candid = (props) => {
    return (
        <div>
            <img src={Frame}></img>
            <div className='title gap-x-5'>
                <h1>{props.id}</h1>
                <div>
                    <h2>{props.name}</h2>
                    <h3 className='font-light'>{props.division}</h3>
                </div>
            </div>
        </div>
    );
};

export default Candid;
